import React, { Component } from "react";
import "../styles/Main.css";

class Main extends Component{
    render() {
        return (<div class="main-page">
            <div class="top-panel">
                <a class="main-page-redirect" href="/front/public/index.html">
                    <img class="main-page-redirect-image" src="../styles/img/logo_test.png"/>
                </a>
                <div class="search-panel">
                    <form action="/search/" autocomplete="off" class="form-search" method="get" role="search">
                        <input type="search" class="search" placeholder="Поиск" />
                    </form>
                </div>
                <div class="login">
                    <button class="login-redirect">Войти</button> 
                </div>
                <div class="register">
                    <button class="register-redirect">Зарегистрироваться</button>
                </div>
            </div>
        </div>);
    }
}

export default Main;
